@shr1ftyy[τ,ℶ,κ] | SN26, SN10 my miner was registered as allocation miner
but sometimes, my miner receive the taofi_lp requests from validators
how can I solve the problem?

go here: http://34.55.201.138/graphql
and run this query:
```graphql
query GetBurns {
  burns(limit: 100, where: {timestamp_gte: "2025-09-13T01:30:00.000000Z", origin_eq: "0x7d3d8f14e1a78378a0a8e329648c0c708482db05"}) {
    amount0
    amount1
    tickLower
    tickUpper
    origin
  }
}
```

